                </Grid>
                <Grid item xs={12}>
                    <Typography variant="body2" component="p" style={{ textAlign: 'left', paddingLeft: '20px', borderBottom: "2px solid rgb(212, 212, 212)", padding}}>events coming up soon</Typography>
                </Grid>
            </Grid>
        </Paper>
    )
}
